import React from 'react';
import 'Blayout.css'

const Blayout = () => {
	return(
     <div>
        <ul className='list'>
        	<li>Barber Shop</li>
        	<li>Parlo Salon</li>
        	<li>Parlo Tatto</li>
        	<li>Others</li>
        </ul>
      </div>
	);
}

export default Blayout;
